import { Link } from "react-router-dom";
// import { Button } from 'react-bootstrap';
const Home = () => {
  return (
    <div className="section">
    <div className="button-div">
      <h1>3D Models</h1>

      <div className="link-tab">
        <Link to="/Model1">
          <button className="btn">
            <span>P1</span>
            </button>
          </Link>
      </div>

      <div className="link-tab">
      <Link to="/Model2">
        <button className="btn">
          P2
        </button>
      </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model3">
          <button className="btn">
            P3
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model4">
          <button className="btn">
            P4
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model6">
          <button className="btn">
            P6
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model7">
          <button className="btn">
            P7
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model8">
          <button className="btn">
            P8
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model9">
          <button className="btn">
            P9
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model12">
          <button className="btn">
            P12
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model13">
          <button className="btn">
            P13
            </button>
          </Link>
      </div>
      <div className="link-tab">
        <Link to="/Model17">
          <button className="btn">
            P17
            </button>
          </Link>
      </div>
      </div>
    </div>
  );
};

export default Home;
